import {DELETE_WALLET, GET_WALLETS} from '../Actions/DispatcherTypes'
const initialState = {
    wallets:[]
}

export default function generic (state = initialState, action){
    switch(action.type) 
    {
        case GET_WALLETS:
            return {...state,wallets:action.payload};
        case DELETE_WALLET:    
        default:
            return state;
    }
}
